import './App.css';
import PriceTable from './components/PriceTable';
import Sales from './components/Sales';
function App() {

  return (
    <div className="App">
      <div className="section">

        <button>NFT </button> |
        <button>Sales</button>


      </div>
      <Sales />
      <PriceTable />
    </div>

  );
}

export default App;
